import { Link } from "react-router-dom";

export default function Navbar() {
    return (
        <nav className="bg-white shadow p-4 flex justify-between items-center flex-row-reverse">
            {/* اسم الموقع */}
            <Link to="/" className="text-xl font-bold text-blue-600">
                مكتبة الحرافيش
            </Link>

            {/* الروابط */}
            <div className="space-x-reverse space-x-4">
                <Link to="/" className="text-gray-700 hover:text-blue-600">
                    الرئيسية
                </Link>
                <Link to="/category" className="text-gray-700 hover:text-blue-600">
                    تسوق
                </Link>
                <Link to="/favorites" className="text-gray-700 hover:text-blue-600">
                    المفضلة
                </Link>
            </div>
        </nav>
    );
}
